This endpoint returns circle balances information for display in the admin portal

## Request query params
```json
{
"company_id": "string"
}
```

## Request body
`None`

## Response (with circle balances)

```json
{
  "available": {
    "amount": "",
    "currency": ""
  },
  "unsettled": {
    "amount": "",
    "currency": ""
  }
}
```

## Error responses
```json
{  
  "error": "error"
}
```

